import "./app.css";

const VerticalBar = () => {
  return (
    <div className="sidebar">
      <div className="row">
        <div className="col-1">
          <nav class="navbar navbar-light bg-light">
            <div class="container-fluid">
              <a class="navbar-brand" href="#">
                Navbar
              </a>
            </div>
          </nav>

          <nav class="navbar navbar-light bg-light">
            <div class="container-fluid">
              <span class="navbar-brand mb-0 h1">Navbar</span>
            </div>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default VerticalBar;
